    def start(self, game:str):
        '''
        Starts an OpenAI gym environment.
        Caller:
            - Trial.start()
        Inputs:
            -   game (Type: str corresponding to allowable gym environments)
        Returs:
            - env (Type: OpenAI gym Environment as returned by gym.make())
            Mandatory
        '''
        #self.env = gym.make(game, render_mode= 'rgb_array', continuous=False, domain_randomize=False)
        self.env = gym.make(game)
        

        print('inside agent start')
        print('game', game)
        print('self.env', self.env)
        return
    def save_transition(self, next_obs, action, reward, done):
        self.transition['obs'] = np.array(self.current_obs, dtype= np.float32)
        self.transition['next_obs'] = np.array(next_obs, dtype= np.float32)
        self.transition['reward'] = reward
        self.transition['acts'] = action
        self.transition['dones'] = done
        
    def step(self, action:int):
        '''
        Takes a game step.
        Caller: 
            - Trial.take_step()
        Inputs:
            - env (Type: OpenAI gym Environment)
            - action (Type: int corresponding to action in env.action_space)
        Returns:
            - envState (Type: dict containing all information to be recorded for future use)
              change contents of dict as desired, but return must be type dict.
        '''
        #next_observation, reward, terminated, truncated, info = self.env.step(action)
        terminated, truncated = False, False
        next_observation, reward, done, info = self.env.step(action)

        #done = terminated or truncated
        envState = {'observation': next_observation, 'reward': reward, 'done': done, 'terminated': terminated, 'truncated': truncated, 'info': info}
        self.save_transition(next_observation, action, reward, done)
        self.current_obs = next_observation
        
        self.replay_buffer_of_demos[self.episode].append(action)
        return envState, self.transition
    
    def render(self):
        '''
        Gets render from gym.
        Caller:
            - Trial.get_render()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns:
            - return from env.render('rgb_array') (Type: npArray)
              must return the unchanged rgb_array
        '''
        #print('inside agent.render')
        #return self.env.render()
        return self.env.render('rgb_array')
    

       

    def reset(self):
        '''
        Resets the environment to start new episode.
        Caller: 
            - Trial.reset()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns: 
            No Return
        '''
        
        self.episode+=1
        print('agent reset')
        print(f'episode = {self.episode}')
        self.env.seed(0)
        #self.current_obs, info = self.env.reset(seed=0)
        self.current_obs  = self.env.reset()

        print('inital_state', self.current_obs)

        # self.replay_buffer_of_demos[self.episode] = list()
        # print(self.replay_buffer_of_demos)
        # print(self.replay_buffer_of_demos[self.episode])
        print('\n')
        print('\n')
        print('\n')
        print('\n')
        print('\n')
        print('\n')
        print('\n')
        print('\n')


    
    def close(self):
        '''
        Closes the environment at the end of the trial.
        Caller:
            - Trial.close()
        Inputs:
            - env (Type: OpenAI gym Environment)
        Returns:
            No Return
        '''
        print(self.replay_buffer_of_demos)
        self.env.close()
